import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

const Signup = () => {
  const [firstName, setFirstName] = useState("");
  const [lastName, setLastName] = useState("");
  const [email, setEmail] = useState("");
  const [course, setCourse] = useState("");
  const [role, setRole] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");
  const [profileImage, setProfileImage] = useState(null);
  const navigate = useNavigate();

  const handleImageUpload = (e) => {
    setProfileImage(URL.createObjectURL(e.target.files[0]));
  };

  const handleSignUp = (e) => {
    e.preventDefault();

    if (password !== confirmPassword) {
      alert("Passwords do not match!");
      return;
    }

    navigate("/signup-success", { state: { email } });
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-gray-200 p-4">
      <div className="bg-white p-8 rounded-lg shadow-md w-full max-w-md">
        <h2 className="text-2xl font-bold text-gray-800 text-center mb-4">Create an Account</h2>

        {/* Image Upload Preview */}
        <div className="flex justify-center mb-4">
          {profileImage ? (
            <img src={profileImage} alt="Profile" className="w-24 h-24 rounded-full border" />
          ) : (
            <div className="w-24 h-24 rounded-full border flex items-center justify-center text-gray-500">
              No Image
            </div>
          )}
        </div>

        <form onSubmit={handleSignUp}>
          {/* Name Fields */}
          <div className="grid grid-cols-2 gap-4">
            <input
              type="text"
              placeholder="First Name"
              className="w-full px-4 py-2 border rounded-md focus:ring-2 focus:ring-indigo-400"
              onChange={(e) => setFirstName(e.target.value)}
              required
            />
            <input
              type="text"
              placeholder="Last Name"
              className="w-full px-4 py-2 border rounded-md focus:ring-2 focus:ring-indigo-400"
              onChange={(e) => setLastName(e.target.value)}
              required
            />
          </div>

          {/* Email Input */}
          <div className="my-4">
            <input
              type="email"
              placeholder="Enter your email"
              className="w-full px-4 py-2 border rounded-md focus:ring-2 focus:ring-indigo-400"
              onChange={(e) => setEmail(e.target.value)}
              required
            />
          </div>

          {/* Role and Course Selection */}
          <div className="grid grid-cols-2 gap-4">
            <select
              className="w-full px-4 py-2 border rounded-md focus:ring-2 focus:ring-indigo-400"
              onChange={(e) => setCourse(e.target.value)}
              required
            >
              <option value="">Choose Course</option>
              <option value="Web Development">Web Development</option>
              <option value="Data Science">Data Science</option>
              <option value="Graphic Design">Graphic Design</option>
            </select>

            <select
              className="w-full px-4 py-2 border rounded-md focus:ring-2 focus:ring-indigo-400"
              onChange={(e) => setRole(e.target.value)}
              required
            >
              <option value="">Choose Role</option>
              <option value="Student">Student</option>
              <option value="Instructor">Instructor</option>
            </select>
          </div>

          {/* Password Fields */}
          <div className="my-4">
            <input
              type="password"
              placeholder="Enter password"
              className="w-full px-4 py-2 border rounded-md focus:ring-2 focus:ring-indigo-400"
              onChange={(e) => setPassword(e.target.value)}
              required
            />
          </div>

          <div className="mb-4">
            <input
              type="password"
              placeholder="Confirm password"
              className="w-full px-4 py-2 border rounded-md focus:ring-2 focus:ring-indigo-400"
              onChange={(e) => setConfirmPassword(e.target.value)}
              required
            />
          </div>

          {/* Image Upload */}
          <div className="mb-4">
            <input type="file" accept="image/*" onChange={handleImageUpload} />
          </div>

          {/* Submit Button */}
          <button
            type="submit"
            className="w-full bg-indigo-600 text-white py-2 rounded-md hover:bg-indigo-700 transition"
          >
            Sign Up
          </button>
        </form>
      </div>
    </div>
  );
};

export default Signup;
